/// User-customized setup for SKIPDATA option
final class cs_opt_skipdata extends ffi.Struct {
  /// Capstone considers data to skip as special "instructions".
  /// User can specify the string for this instruction's "mnemonic" here.
  /// By default (if @mnemonic is NULL), Capstone use ".byte".
  external ffi.Pointer<ffi.Char> mnemonic;

  /// User-defined callback function to be called when Capstone hits data.
  /// If the returned value from this callback is positive (>0), Capstone
  /// will skip exactly that number of bytes & continue. Otherwise, if
  /// the callback returns 0, Capstone stops disassembling and returns
  /// immediately from cs_disasm()
  /// NOTE: if this callback pointer is NULL, Capstone would skip a number
  /// of bytes depending on architectures, as following:
  /// Arm:     2 bytes (Thumb mode) or 4 bytes.
  /// Arm64:   4 bytes.
  /// Mips:    4 bytes.
  /// M680x:   1 byte.
  /// PowerPC: 4 bytes.
  /// Sparc:   4 bytes.
  /// SystemZ: 2 bytes.
  /// X86:     1 bytes.
  /// XCore:   2 bytes.
  /// EVM:     1 bytes.
  /// RISCV:   4 bytes.
  /// WASM:    1 bytes.
  /// MOS65XX: 1 bytes.
  /// BPF:     8 bytes.
  /// TriCore: 2 bytes.
  external cs_skipdata_cb_t callback;

  /// User-defined data to be passed to @callback function pointer.
  external ffi.Pointer<ffi.Void> user_data;
}

/// User-defined callback function for SKIPDATA option.
/// See tests/test_skipdata.c for sample code demonstrating this API.
///
/// @code: the input buffer containing code to be disassembled.
/// This is the same buffer passed to cs_disasm().
/// @code_size: size (in bytes) of the above @code buffer.
/// @offset: the position of the currently-examining byte in the input
/// buffer @code mentioned above.
/// @user_data: user-data passed to cs_option() via @user_data field in
/// cs_opt_skipdata struct below.
///
/// @return: return number of bytes to skip, or 0 to immediately stop disassembling.
typedef cs_skipdata_cb_t
    = ffi.Pointer<ffi.NativeFunction<cs_skipdata_cb_tFunction>>;
typedef cs_skipdata_cb_tFunction = ffi.Size Function(
    ffi.Pointer<ffi.Uint8> code,
    ffi.Size code_size,
    ffi.Size offset,
    ffi.Pointer<ffi.Void> user_data);
typedef Dartcs_skipdata_cb_tFunction = int Function(ffi.Pointer<ffi.Uint8> code,
    int code_size, int offset, ffi.Pointer<ffi.Void> user_data);

