/// Instruction's operand referring to memory
/// This is associated with ARM64_OP_MEM operand type above
final class arm64_op_mem extends ffi.Struct {
  /// < base register
  @ffi.Int32()
  external int base;

  /// < index register
  @ffi.Int32()
  external int index;

  /// < displacement/offset value
  @ffi.Int32()
  external int disp;
}

/// SME Instruction's operand has index
/// This is associated with ARM64_OP_SME_INDEX operand type above
final class arm64_op_sme_index extends ffi.Struct {
  /// < register being indexed
  @ffi.Int32()
  external int reg;

  /// < base register
  @ffi.Int32()
  external int base;

  /// < displacement/offset value
  @ffi.Int32()
  external int disp;
}

/// Instruction operand
final class cs_arm64_op extends ffi.Struct {
  /// < Vector Index for some vector operands (or -1 if
  /// < irrelevant)
  @ffi.Int()
  external int vector_index;

  /// < Vector Arrangement Specifier
  @ffi.Int32()
  external int vas;

  external UnnamedStruct2 shift;

  /// < extender type of this operand
  @ffi.Int32()
  external int ext;

  /// < operand type
  @ffi.Int32()
  external int type;

  /// < MSR/MRS SVCR instruction variant.
  @ffi.Int32()
  external int svcr;

  external UnnamedUnion2 unnamed;

  /// How is this operand accessed? (READ, WRITE or READ|WRITE)
  /// This field is combined of cs_ac_type.
  /// NOTE: this field is irrelevant if engine is compiled in DIET mode.
  @ffi.Uint8()
  external int access;
}

final class UnnamedStruct2 extends ffi.Struct {
  /// < shifter type of this operand
  @ffi.Int32()
  external int type;

  /// < shifter value of this operand
  @ffi.UnsignedInt()
  external int value;
}

final class UnnamedUnion2 extends ffi.Union {
  /// < register value for REG operand
  @ffi.Int32()
  external int reg;

  /// < immediate value, or index for C-IMM or IMM operand
  @ffi.Int64()
  external int imm;

  /// < floating point value for FP operand
  @ffi.Double()
  external double fp;

  /// < base/index/scale/disp value for MEM operand
  external arm64_op_mem mem;

  /// < PState field of MSR instruction.
  @ffi.Int32()
  external int pstate;

  /// < IC/DC/AT/TLBI operation (see arm64_ic_op,
  /// < arm64_dc_op, arm64_at_op, arm64_tlbi_op)
  @ffi.Int32()
  external int sys;

  /// < PRFM operation.
  @ffi.Int32()
  external int prefetch;

  /// < Memory barrier operation (ISB/DMB/DSB instructions).
  @ffi.Int32()
  external int barrier;

  /// < base/disp value for matrix tile slice
  /// < instructions.
  external arm64_op_sme_index sme_index;
}

/// Instruction structure
final class cs_arm64 extends ffi.Struct {
  /// < conditional code for this insn
  @ffi.Int32()
  external int cc;

  /// < does this insn update flags?
  @ffi.Bool()
  external bool update_flags;

  /// < does this insn request writeback? 'True' means 'yes'
  @ffi.Bool()
  external bool writeback;

  /// < only set if writeback is 'True', if 'False' pre-index, otherwise post.
  @ffi.Bool()
  external bool post_index;

  /// Number of operands of this instruction,
  /// or 0 when instruction has no operand.
  @ffi.Uint8()
  external int op_count;

  /// < operands for this instruction.
  @ffi.Array.multi([8])
  external ffi.Array<cs_arm64_op> operands;
}

