/// Instruction's operand referring to memory
/// This is associated with MIPS_OP_MEM operand type above
final class mips_op_mem extends ffi.Struct {
  /// < base register
  @ffi.Int32()
  external int base;

  /// < displacement/offset value
  @ffi.Int64()
  external int disp;
}

/// Instruction operand
final class cs_mips_op extends ffi.Struct {
  /// < operand type
  @ffi.Int32()
  external int type;

  external UnnamedUnion5 unnamed;
}

final class UnnamedUnion5 extends ffi.Union {
  /// < register id for REG operand
  @ffi.Int32()
  external int reg;

  /// < immediate value for IMM operand
  @ffi.Int64()
  external int imm;

  /// < base/index/scale/disp value for MEM operand
  external mips_op_mem mem;
}

/// Instruction structure
final class cs_mips extends ffi.Struct {
  /// Number of operands of this instruction,
  /// or 0 when instruction has no operand.
  @ffi.Uint8()
  external int op_count;

  /// < operands for this instruction.
  @ffi.Array.multi([10])
  external ffi.Array<cs_mips_op> operands;
}

