/// Instruction's operand referring to memory
/// This is associated with PPC_OP_MEM operand type above
final class ppc_op_mem extends ffi.Struct {
  /// < base register
  @ffi.Int32()
  external int base;

  /// < displacement/offset value
  @ffi.Int32()
  external int disp;
}

final class ppc_op_crx extends ffi.Struct {
  @ffi.UnsignedInt()
  external int scale;

  @ffi.Int32()
  external int reg;

  @ffi.Int32()
  external int cond;
}

/// Instruction operand
final class cs_ppc_op extends ffi.Struct {
  /// < operand type
  @ffi.Int32()
  external int type;

  external UnnamedUnion6 unnamed;
}

final class UnnamedUnion6 extends ffi.Union {
  /// < register value for REG operand
  @ffi.Int32()
  external int reg;

  /// < immediate value for IMM operand
  @ffi.Int64()
  external int imm;

  /// < base/disp value for MEM operand
  external ppc_op_mem mem;

  /// < operand with condition register
  external ppc_op_crx crx;
}

/// Instruction structure
final class cs_ppc extends ffi.Struct {
  /// branch code for branch instructions
  @ffi.Int32()
  external int bc;

  /// branch hint for branch instructions
  @ffi.Int32()
  external int bh;

  /// if update_cr0 = True, then this 'dot' insn updates CR0
  @ffi.Bool()
  external bool update_cr0;

  /// Number of operands of this instruction,
  /// or 0 when instruction has no operand.
  @ffi.Uint8()
  external int op_count;

  /// < operands for this instruction.
  @ffi.Array.multi([8])
  external ffi.Array<cs_ppc_op> operands;
}

