/// Instruction's operand referring to memory
/// This is associated with SPARC_OP_MEM operand type above
final class sparc_op_mem extends ffi.Struct {
  /// < base register, can be safely interpreted as
  /// < a value of type `sparc_reg`, but it is only
  /// < one byte wide
  @ffi.Uint8()
  external int base;

  /// < index register, same conditions apply here
  @ffi.Uint8()
  external int index;

  /// < displacement/offset value
  @ffi.Int32()
  external int disp;
}

/// Instruction operand
final class cs_sparc_op extends ffi.Struct {
  /// < operand type
  @ffi.Int32()
  external int type;

  external UnnamedUnion7 unnamed;
}

final class UnnamedUnion7 extends ffi.Union {
  /// < register value for REG operand
  @ffi.Int32()
  external int reg;

  /// < immediate value for IMM operand
  @ffi.Int64()
  external int imm;

  /// < base/disp value for MEM operand
  external sparc_op_mem mem;
}

/// Instruction structure
final class cs_sparc extends ffi.Struct {
  /// < code condition for this insn
  @ffi.Int32()
  external int cc;

  /// < branch hint: encoding as bitwise OR of sparc_hint.
  @ffi.Int32()
  external int hint;

  /// Number of operands of this instruction,
  /// or 0 when instruction has no operand.
  @ffi.Uint8()
  external int op_count;

  /// < operands for this instruction.
  @ffi.Array.multi([4])
  external ffi.Array<cs_sparc_op> operands;
}

