/// Instruction's operand referring to memory
/// This is associated with SYSZ_OP_MEM operand type above
final class sysz_op_mem extends ffi.Struct {
  /// < base register, can be safely interpreted as
  /// < a value of type `sysz_reg`, but it is only
  /// < one byte wide
  @ffi.Uint8()
  external int base;

  /// < index register, same conditions apply here
  @ffi.Uint8()
  external int index;

  /// < BDLAddr operand
  @ffi.Uint64()
  external int length;

  /// < displacement/offset value
  @ffi.Int64()
  external int disp;
}

/// Instruction operand
final class cs_sysz_op extends ffi.Struct {
  /// < operand type
  @ffi.Int32()
  external int type;

  external UnnamedUnion8 unnamed;
}

final class UnnamedUnion8 extends ffi.Union {
  /// < register value for REG operand
  @ffi.Int32()
  external int reg;

  /// < immediate value for IMM operand
  @ffi.Int64()
  external int imm;

  /// < base/disp value for MEM operand
  external sysz_op_mem mem;
}

final class cs_sysz extends ffi.Struct {
  /// < Code condition
  @ffi.Int32()
  external int cc;

  /// Number of operands of this instruction,
  /// or 0 when instruction has no operand.
  @ffi.Uint8()
  external int op_count;

  /// < operands for this instruction.
  @ffi.Array.multi([6])
  external ffi.Array<cs_sysz_op> operands;
}

