/// Instruction's operand referring to memory
/// This is associated with XCORE_OP_MEM operand type above
final class xcore_op_mem extends ffi.Struct {
  /// < base register, can be safely interpreted as
  /// < a value of type `xcore_reg`, but it is only
  /// < one byte wide
  @ffi.Uint8()
  external int base;

  /// < index register, same conditions apply here
  @ffi.Uint8()
  external int index;

  /// < displacement/offset value
  @ffi.Int32()
  external int disp;

  /// < +1: forward, -1: backward
  @ffi.Int()
  external int direct;
}

/// Instruction operand
final class cs_xcore_op extends ffi.Struct {
  /// < operand type
  @ffi.Int32()
  external int type;

  external UnnamedUnion11 unnamed;
}

final class UnnamedUnion11 extends ffi.Union {
  /// < register value for REG operand
  @ffi.Int32()
  external int reg;

  /// < immediate value for IMM operand
  @ffi.Int32()
  external int imm;

  /// < base/disp value for MEM operand
  external xcore_op_mem mem;
}

/// Instruction structure
final class cs_xcore extends ffi.Struct {
  /// Number of operands of this instruction,
  /// or 0 when instruction has no operand.
  @ffi.Uint8()
  external int op_count;

  /// < operands for this instruction.
  @ffi.Array.multi([8])
  external ffi.Array<cs_xcore_op> operands;
}

